('2394','18','7912','Haus Clara',Null,'Stadthaus in Santa Maria mit Gemüsegarten zu verkaufen','33651','Das Stadthaus liegt am Stadtrand von Santa Maria, nur 15 Fahrminuten von Palma entfernt. Im EG befinden sich eine Küche, Gäste WC, Wohn-Esszimmer mit Zugang zum Garten mit Babacue. In einem kleinen Nebengebäude befindet sich ein Waschmaschinenraum. Im 1. OG hat es eine Galerie, die man als Büro nutzen kann, 2 Schlafzimmer und ein Badezimmer mit Badewanne. Eine Klimaanlage w/k und elektrische Radiatoren sorgen im Haus Sommer wie Winter für die richtige Temperatur. Ein 6x15m großer Garten eignet sich sehr gut um eigenes Gemüse anzubauen. Parkmöglichkeiten hat es auf der Strasse. Hübsches Haus zum Preis eines Apartments?','33652','360000','106','2015-10-16 09:57:02','106','2015-10-16 09:57:54',Null,'2503','120','1174',1,'1','0',Null,Null,Null,'33653',Null,'0','0','0',Null,'2015-10-16 10:16:31',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33654',Null,'33655',Null,'33656',Null,'33657','616 500 114   meseguer.carl@gmail.com','33658','0',0,'0');
